import Video from './demo_vids/parking.mp4';
import Poster from './demo_vids/parking.png';
import Img from './images/parking.png';
export const emptyparking = {
    lightBg: false,
    lightText: true,
    lightTextDesc: true,
    headline: 'Empty Parking Detection',
    description:
      'For this functionality, we need to detect two things: 1: Vacancy 2: Hotspot. We are using Deep Learning to detect empty parking space.',
    imgStart: '',
    img: Img,
    alt: 'Credit Card',
    path: Video,
    poster: Poster
  };
